              <span style ={{"text-align":"right", "padding":"15px"}}>size <small className=" text-muted ">  {props.data.Season}</small></span>
              <div>
              { props.data.category ? <span style ={{"text-align":"right"}}>Category : {props.data.category}</span> :'' }

              </div>

        </div>
        </div> 


        </div>

            )
        }
        else{
            return null
        }
}
export default Card
